import React, { useEffect } from 'react';

const EnvTest = () => {
  useEffect(() => {
    console.log('Firebase API Key:', process.env.REACT_APP_FIREBASE_API_KEY);
    console.log('Firebase Auth Domain:', process.env.REACT_APP_FIREBASE_AUTH_DOMAIN);
  }, []);

  return null;
};

export default EnvTest;
